import React, { useEffect } from 'react';
import { useSelector } from 'react-redux';
import { Link } from 'react-router-dom';
import { RootState } from '../../components/store';
import { useNavigate } from 'react-router-dom';
import Product from '../../types/product';
import Header from "../../components/Header";
import Box from "../../components/Box";
import Footer from "../../components/Footer";
import { DivSucesso, Back } from './styles';
import {  DivUl, LiUnit } from '../../components/Cart/styles';

const Sucess: React.FC = () => {
  const products = useSelector((state: RootState) => state.cart.products);
  const productList = Object.values(products);

  return (
    <div>
      <Header />
      <DivSucesso>
        <h1>Compra realizada com sucesso!</h1>
        <p>Obrigado por fazer sua compra.</p>
        <p>Seu pedido foi processado e em breve ser√° enviado.</p>

        <Back as={Link} to="/produtos">Continuar comprando</Back>
      </DivSucesso>

      <DivUl>
        {productList.map((product: Product) => (
          <LiUnit key={product.id}>
            <div>
              <h1>{product.name}</h1>
              <p><strong>$ {product.price} </strong> cada</p>
              <p>{product.description}</p>
              <p>{product.category}</p>
            </div>
          </LiUnit>
        ))}
      </DivUl>

      <Footer />
    </div>
  );
};

export default Sucess;
